from httpie.cli.definition import parser as http_parser
from httpie.manager.cli import COMMANDS



if len(args) >= 1 and args[0] in COMMANDS:
    return False

with env.as_silent():
    try:
        http_parser.parse_args(env=env, args=args)
    except (Exception, SystemExit):
        return False
    else:
        return True
